insert into Launch(id, flight_number, name, date_utc, details) values('5eb87ce0ffd86e000604b332', '9', 'CRS-1', '2012-10-08T00:35:00.000Z', 'CRS-1 successful, but the secondary payload was inserted into abnormally low orbit and lost due to Falcon 9 boost stage engine failure, ISS visiting vehicle safety rules, and the primary payload owner''s contractual right to decline a second ignition of the second stage under some conditions.');
