insert into Launch(id, flight_number, name, date_utc, details) values('5eb87ce1ffd86e000604b334', '11', 'CASSIOPE', '2013-09-29T16:00:00.000Z', 'Commercial mission and first Falcon 9 v1.1 flight, with improved 13-tonne to LEO capacity. Following second-stage separation from the first stage, an attempt was made to perform an ocean touchdown test of the discarded booster vehicle. The test provided good test data on the experiment-its primary objective-but as the booster neared the ocean, aerodynamic forces caused an uncontrollable roll. The center engine, depleted of fuel by centrifugal force, shut down resulting in the impact and destruction of the vehicle.');
