insert into Launch(id, flight_number, name, date_utc, details) values('5eb87ce3ffd86e000604b336', '13', 'Thaicom 6', '2014-01-06T18:06:00.000Z', 'Second GTO launch for Falcon 9. The USAF evaluated launch data from this flight as part of a separate certification program for SpaceX to qualify to fly U.S. military payloads and found that the Thaicom 6 launch had "unacceptable fuel reserves at engine cutoff of the stage 2 second burnoff"');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87ce3ffd86e000604b336', 'http://localhost:3000/images/fnqIBEJh_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87ce3ffd86e000604b336', 'http://localhost:3000/images/jRAk115c_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87ce4ffd86e000604b337', '14', 'CRS-3', '2014-04-18T19:25:00.000Z', 'Following second-stage separation, SpaceX conducted a second controlled-descent test of the discarded booster vehicle and achieved the first successful controlled ocean touchdown of a liquid-rocket-engine orbital booster. Following touchdown the first stage tipped over as expected and was destroyed. This was the first Falcon 9 booster to fly with extensible landing legs and the first Dragon mission with the Falcon 9 v1.1 launch vehicle.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87ce4ffd86e000604b337', 'http://localhost:3000/images/s1h2RuR0_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87ce4ffd86e000604b337', 'http://localhost:3000/images/EOWojaSj_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87ce4ffd86e000604b338', '15', 'OG-2 Mission 1', '2014-07-14T15:15:00.000Z', 'Total payload mass was 1,316 kg (2,901 lb) : 6 satellites weighing 172 kg each, plus two 142-kg mass simulators. This was the second Falcon 9 booster equipped with landing legs. Following second-stage separation, SpaceX conducted a controlled-descent test of the first stage, which successfully decelerated from hypersonic velocity in the upper atmosphere, made reentry and landing burns, deployed its legs and touched down on the ocean surface. As with the previous mission, the first stage then tipped over as expected and was not recovered.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87ce4ffd86e000604b338', 'http://localhost:3000/images/bcMrHMey_o.png');
