insert into Launch(id, flight_number, name, date_utc, details) values('5eb87ce8ffd86e000604b33c', '19', 'CRS-5', '2015-01-10T09:47:00.000Z', 'Following second stage separation, SpaceX performed a test flight which attempted to return the first stage of the Falcon 9 through the atmosphere and land it on an approximately 90-by-50-meter (300 ft x 160 ft) floating platform-called the autonomous spaceport drone ship. Many of the test objectives were achieved, including precision control of the rocket''s descent to land on the platform at a specific point in the Atlantic ocean, and a large amount of test data was obtained from the first use of grid fin control surfaces used for more precise reentry positioning. The grid fin control system ran out of hydraulic fluid a minute before landing and the landing itself resulted in a crash.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87ce8ffd86e000604b33c', 'http://localhost:3000/images/RhNppyL3_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87ce8ffd86e000604b33c', 'http://localhost:3000/images/WyQS4MXa_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87ceaffd86e000604b33d', '20', 'DSCOVR', '2015-02-11T23:03:00.000Z', 'First launch under USAF''s OSP 3 launch contract. First SpaceX launch to put a satellite to an orbit with an orbital altitude many times the distance to the Moon: Sun-Earth libration point L1. The first stage made a test flight descent to an over-ocean landing within 10 m (33 ft) of its intended target.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87ceaffd86e000604b33d', 'http://localhost:3000/images/0OIpD59z_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87ceaffd86e000604b33d', 'http://localhost:3000/images/kTPQRyzt_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87ceaffd86e000604b33e', '21', 'ABS-3A / Eutelsat 115W B', '2015-03-02T03:50:00.000Z', 'The launch was Boeing''s first-ever conjoined launch of a lighter-weight dual-commsat stack that was specifically designed to take advantage of the lower-cost SpaceX Falcon 9 launch vehicle. Per satellite, launch costs were less than $30 million. The ABS satellite reached its final destination ahead of schedule and started operations on September 10.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87ceaffd86e000604b33e', 'http://localhost:3000/images/sqPgZfej_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87ceaffd86e000604b33e', 'http://localhost:3000/images/H9gthFmK_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87cecffd86e000604b33f', '22', 'CRS-6', '2015-04-14T20:10:00.000Z', 'Following the first-stage boost, SpaceX attempted a controlled-descent test of the first stage. The first stage contacted the ship, but soon tipped over due to excess lateral velocity caused by a stuck throttle valve resulting in a later-than-intended downthrottle.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87cecffd86e000604b33f', 'http://localhost:3000/images/kbVulokl_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87cecffd86e000604b33f', 'http://localhost:3000/images/GRP89UBo_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87cedffd86e000604b340', '23', 'TürkmenÄlem 52°E / MonacoSAT', '2015-04-27T23:03:00.000Z', 'null');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87cedffd86e000604b340', 'http://localhost:3000/images/VNpbqUPb_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87cedffd86e000604b340', 'http://localhost:3000/images/RLkM4sNw_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87ceeffd86e000604b341', '24', 'CRS-7', '2015-06-28T14:21:00.000Z', 'Launch performance was nominal until an overpressure incident in the second-stage LOX tank, leading to vehicle breakup at T+150 seconds. The Dragon capsule survived the explosion but was lost upon splashdown because its software did not contain provisions for parachute deployment on launch vehicle failure.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87ceeffd86e000604b341', 'http://localhost:3000/images/gyTVYo21_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87ceeffd86e000604b341', 'http://localhost:3000/images/stH98Qy1_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87cefffd86e000604b342', '25', 'OG-2 Mission 2', '2015-12-22T01:29:00.000Z', 'Total payload mass was 2,034 kg (4,484 lb) : 11 satellites weighing 172 kg each, plus a 142-kg mass simulator. This was the first launch of the upgraded v1.1 variant (later called Falcon 9 Full Thrust), with a 30 percent power increase. Orbcomm had originally agreed to be the third flight of the enhanced-thrust rocket, but the change to the maiden flight position was announced in October 2015. SpaceX received a permit from the FAA to land the booster on solid ground at Cape Canaveral, and succeeded.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87cefffd86e000604b342', 'http://localhost:3000/images/5eeThzqZ_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87cefffd86e000604b342', 'http://localhost:3000/images/8iNE9T6Y_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87cf0ffd86e000604b343', '26', 'Jason 3', '2016-01-17T15:42:00.000Z', 'First launch of NASA and NOAA joint science mission under the NLS II launch contract (not related to NASA CRS or USAF OSP3 contracts). Last launch of the original Falcon 9 v1.1 launch vehicle. The Jason-3 satellite was successfully deployed to target orbit. SpaceX again attempted a recovery of the first stage booster by landing on an autonomous drone ship; this time located in the Pacific Ocean. The first stage did achieve a soft-landing on the ship, but a lockout on one of the landing legs failed to latch, so that the booster fell over and exploded.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87cf0ffd86e000604b343', 'http://localhost:3000/images/uK9vYzvk_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87cf0ffd86e000604b343', 'http://localhost:3000/images/j489OwAI_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87cf2ffd86e000604b344', '27', 'SES-9', '2016-03-04T23:35:00.000Z', 'Second launch of the enhanced Falcon 9 Full Thrust launch vehicle. Following the launch, SpaceX attempted an experimental landing test to a drone ship, although a successful landing was not expected because launch mass exceeded previously indicated limit for a GTO there was little fuel left. As predicted, booster recovery failed: the spent first stage "landed hard", but the controlled-descent, atmospheric re-entry and navigation to the drone ship were successful and returned significant test data on bringing back high-energy Falcon 9s.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87cf2ffd86e000604b344', 'http://localhost:3000/images/4FBvVReu_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87cf2ffd86e000604b344', 'http://localhost:3000/images/xDtGo0WJ_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87cf3ffd86e000604b345', '28', 'CRS-8', '2016-04-08T20:43:00.000Z', 'Dragon carried over 1500 kg of supplies and delivered (stowed in its trunk) the inflatable Bigelow Expandable Activity Module (BEAM) to the ISS for two years of in-orbit tests. The rocket''s first stage landed smoothly on SpaceX''s autonomous spaceport drone ship 9 minutes after liftoff, making this the first ever successful landing of a rocket booster on a ship at sea as part of an orbital launch. The first stage B1021 was later also the first orbital booster to be used again, when launching SES-10 on March 30, 2017.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87cf3ffd86e000604b345', 'http://localhost:3000/images/gkSR50yc_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87cf3ffd86e000604b345', 'http://localhost:3000/images/tyNDMK5j_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87cf5ffd86e000604b346', '29', 'JCSAT-2B', '2016-05-06T05:21:00.000Z', 'Launched the JCSAT 14 communications satellite for Tokyo-based SKY Perfect JSAT Corp. JCSAT 14 will support data networks, television broadcasters and mobile communications users in Japan, East Asia, Russia, Oceania, Hawaii and other Pacific islands. This was the first time a booster successfully landed after a GTO mission.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87cf5ffd86e000604b346', 'http://localhost:3000/images/qViUTdt5_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87cf5ffd86e000604b346', 'http://localhost:3000/images/ddJiuhNV_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87cf6ffd86e000604b347', '30', 'Thaicom 8', '2016-05-27T21:39:00.000Z', 'Manufactured by Orbital ATK, the 3,100-kilogram (6,800 lb) Thaicom 8 communications satellite will serve Thailand, India and Africa from the 78.5° East geostationary location. It is equipped with 24 active Ku-band transponders.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87cf6ffd86e000604b347', 'http://localhost:3000/images/waYRCanq_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87cf6ffd86e000604b347', 'http://localhost:3000/images/5kukvU10_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87cf8ffd86e000604b348', '31', 'ABS-2A / Eutelsat 117W B', '2016-06-15T14:29:00.000Z', 'One year after pioneering this technique on flight 16, Falcon again launched two Boeing 702SP gridded ion thruster satellites in a dual-stack configuration, with the two customers sharing the rocket and mission costs. First stage landing attempt on drone ship failed on landing due to low thrust on one of the three landing engines.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87cf8ffd86e000604b348', 'http://localhost:3000/images/VTH2y7S5_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87cf8ffd86e000604b348', 'http://localhost:3000/images/4ajR03l9_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87cf9ffd86e000604b349', '32', 'CRS-9', '2016-07-18T04:45:00.000Z', 'Among other cargo, an International Docking Adapter (IDA-2) was carried to the ISS. This mission had a successful first-stage landing at Cape Canaveral.*Including the reusable Dragon Capsule, total payload to orbit was 6457 kg.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87cf9ffd86e000604b349', 'http://localhost:3000/images/p5vdNEJF_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87cf9ffd86e000604b349', 'http://localhost:3000/images/rs4MS4HU_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87cfaffd86e000604b34a', '33', 'JCSAT-16', '2016-08-14T05:26:00.000Z', 'First attempt to touch down from a ballistic trajectory using a single-engine landing burn. All previous landings from a ballistic trajectory had fired three engines on the landing-burn, which provided more braking force, but subjected the vehicle to greater structural stresses. The single-engine landing burn takes more time and fuel, but puts less stress on the vehicle.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87cfaffd86e000604b34a', 'http://localhost:3000/images/eLkeQOl8_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87cfaffd86e000604b34a', 'http://localhost:3000/images/KiaMQgym_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87cfbffd86e000604b34b', '34', 'Amos-6', '2016-09-01T13:07:00.000Z', 'The rocket and Amos-6 payload were lost in a launch pad explosion on September 1, 2016 during propellant fill prior to a static fire test. The pad was clear of personnel and there were no injuries.');
