insert into Launch(id, flight_number, name, date_utc, details) values('5eb87cfdffd86e000604b34c', '35', 'Iridium NEXT Mission 1', '2017-01-14T17:54:00.000Z', 'Return-to-flight mission after the loss of Amos-6 in September 2016. Iridium NEXT will replace the original Iridium constellation, launched in the late 1990s. Each Falcon mission will carry 10 satellites, with a goal to complete deployment of the 66 plus 9 spare satellite constellation by mid 2018. The first two Iridium qualification units were supposed to ride a Dnepr rocket in April 2016 but were delayed, so Iridium decided to qualify the first batch of 10 satellites instead.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87cfdffd86e000604b34c', 'http://localhost:3000/images/5PyY296y_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87cfdffd86e000604b34c', 'http://localhost:3000/images/USCniUHy_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87cfeffd86e000604b34d', '36', 'CRS-10', '2017-02-19T14:39:00.000Z', 'First Falcon 9 flight from the historic LC-39A launchpad at Kennedy Space Center, carrying supplies and materials to support dozens of science and research investigations scheduled during ISS Expeditions 50 and 51. The first stage returned to launch site and landed at LZ-1.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87cfeffd86e000604b34d', 'http://localhost:3000/images/7YmXiSOQ_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87cfeffd86e000604b34d', 'http://localhost:3000/images/hp8DpyGM_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87cfeffd86e000604b34e', '37', 'EchoStar 23', '2017-03-16T06:00:00.000Z', 'Communications satellite for EchoStar Corp. EchoStar XXIII, based on a spare platform from the cancelled CMBStar 1 satellite program, will provide direct-to-home television broadcast services over Brazil. There was no attempt at a first-stage recovery so this rocket did not have landing legs or grid fins.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87cfeffd86e000604b34e', 'http://localhost:3000/images/0X2hNhNK_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87cfeffd86e000604b34e', 'http://localhost:3000/images/mmiTCLkJ_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d00ffd86e000604b34f', '38', 'SES-10', '2017-03-30T22:27:00.000Z', 'First payload to fly on a reused first stage, B1021, previously launched with CRS-8, which also landed a second time. In what is also a first, the payload fairing remained intact after a successful splashdown achieved with thrusters and a steerable parachute.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d00ffd86e000604b34f', 'http://localhost:3000/images/dfj7yRG3_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d00ffd86e000604b34f', 'http://localhost:3000/images/9q2edz2p_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d01ffd86e000604b350', '39', 'NROL-76', '2017-05-01T11:15:00.000Z', 'First launch under SpaceX''s certification for national security space missions, which allows SpaceX to contract launch services for classified payloads. Second-stage speed and altitude telemetry were omitted from the launch webcast, which displayed first-stage telemetry instead, with continuous tracking of the booster from liftoff to landing for the first time.');
