insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d01ffd86e000604b350', 'http://localhost:3000/images/dM1L8DMs_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d01ffd86e000604b351', '40', 'Inmarsat-5 F4', '2017-05-15T23:21:00.000Z', 'At 6,070 kg this was the heaviest payload launched to GTO by a Falcon 9 rocket. The launch was originally scheduled for the Falcon Heavy, but performance improvements allowed the mission to be carried out by an expendable Falcon 9 instead.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d01ffd86e000604b351', 'http://localhost:3000/images/SCoNa79H_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d01ffd86e000604b351', 'http://localhost:3000/images/bJD0zV02_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d03ffd86e000604b352', '41', 'CRS-11', '2017-06-03T21:07:00.000Z', 'This mission delivered the Neutron Star Interior Composition Explorer (NICER) to the ISS, along with the MUSES Earth imaging platform and ROSA solar array. For the first time, this mission launched a refurbished Dragon capsule, serial number C106 which first flew in September 2014 on the CRS-4 mission. Originally scheduled to launch on June 1, but was scrubbed due to inclement weather.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d03ffd86e000604b352', 'http://localhost:3000/images/RV791zv9_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d03ffd86e000604b352', 'http://localhost:3000/images/4irzX449_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d04ffd86e000604b353', '42', 'BulgariaSat-1', '2017-06-23T19:10:00.000Z', 'Second time a booster will be reused: Second flight of B1029 after the Iridium mission of January 2017. The satellite will be the first commercial Bulgarian-owned communications satellite and it will provide television broadcasts and other communications services over southeast Europe.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d04ffd86e000604b353', 'http://localhost:3000/images/Ouyy9Neh_o.png');
