insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d05ffd86e000604b354', '43', 'Iridium NEXT Mission 2', '2017-06-25T20:25:00.000Z', 'First flight with titanium grid fins to improve control authority and better cope with heat during re-entry.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d05ffd86e000604b354', 'http://localhost:3000/images/lNWjUnUS_o.png');
