insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d06ffd86e000604b355', '44', 'Intelsat 35e', '2017-07-05T23:35:00.000Z', 'Due to the constraints of sending a heavy satellite (~6,000 kg) to GTO, the rocket will fly in its expendable configuration and the first-stage booster will not be recovered.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d06ffd86e000604b355', 'http://localhost:3000/images/3l4ib2QW_o.png');
