insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d07ffd86e000604b356', '45', 'CRS-12', '2017-08-14T16:31:00.000Z', 'Dragon is expected to carry 2,349 kg (5,179 lb) of pressurized mass and 961 kg (2,119 lb) unpressurized. The external payload manifested for this flight is the CREAM cosmic-ray detector. First flight of the Falcon 9 Block 4 upgrade. Last flight of a newly-built Dragon capsule; further missions will use refurbished spacecraft.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d07ffd86e000604b356', 'http://localhost:3000/images/M7X1WGKk_o.png');
