insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d08ffd86e000604b357', '46', 'FormoSat-5', '2017-08-24T18:50:00.000Z', 'Formosat-5 is an Earth observation satellite of the Taiwanese space agency. The SHERPA space tug by Spaceflight Industries was removed from the cargo manifest of this mission. The satellite has a mass of only 475 kg.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d08ffd86e000604b357', 'http://localhost:3000/images/3kH19hlj_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d08ffd86e000604b357', 'http://localhost:3000/images/s41i5C9t_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d09ffd86e000604b358', '47', 'Boeing X-37B OTV-5', '2017-09-07T13:50:00.000Z', 'Notable because Boeing is the primary contractor of the X-37B, which has until now been launched by ULA, a SpaceX competitor and Boeing partnership. Second flight of the Falcon 9 Block 4 upgrade.');
