insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d0dffd86e000604b35b', '50', 'KoreaSat 5A', '2017-10-30T19:34:00.000Z', 'KoreaSat 5A is a Ku-band satellite capable of providing communication services from East Africa and Central Asia to southern India, Southeast Asia, the Philippines, Guam, Korea, and Japan. The satellite will be placed in GEO at 113Â° East Longitude, and will provide services ranging from broadband internet to broadcasting services and maritime communications.');
