insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d0effd86e000604b35c', '51', 'CRS-13', '2017-12-15T15:36:00.000Z', 'Will reuse the Dragon capsule previously flown on CRS-6 and will reuse the booster from CRS-11.');
