insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d0fffd86e000604b35d', '52', 'Iridium NEXT Mission 4', '2017-12-23T01:27:23.000Z', 'Reusing the booster first used on Iridium-2, but will be flying expendable.');
