insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d10ffd86e000604b35e', '53', 'ZUMA', '2018-01-08T01:00:00.000Z', 'Originally planned for mid-November 2017, the mission was delayed due to test results from the fairing of another customer. First-stage booster will attempt landing at LZ-1');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d10ffd86e000604b35e', 'http://localhost:3000/images/yMNPvCci_o.png');
