insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d11ffd86e000604b35f', '54', 'SES-16 / GovSat-1', '2018-01-31T21:25:00.000Z', 'Reused booster from the classified NROL-76 mission in May 2017. Following a successful experimental ocean landing that used three engines, the booster unexpectedly remained intact; Elon Musk stated in a tweet that SpaceX will attempt to tow the booster to shore.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d11ffd86e000604b35f', 'http://localhost:3000/images/FoFpPft0_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d11ffd86e000604b35f', 'http://localhost:3000/images/LAupFe3L_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d13ffd86e000604b360', '55', 'Falcon Heavy Test Flight', '2018-02-06T20:45:00.000Z', 'The launch was a success, and the side boosters landed simultaneously at adjacent ground pads. Drone ship landing of the central core failed. Final burn to heliocentric mars-earth orbit was successful after the second stage and payload passed through the Van Allen belts.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d13ffd86e000604b360', 'http://localhost:3000/images/jAAULKc3_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d13ffd86e000604b360', 'http://localhost:3000/images/ujrnfkna_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d14ffd86e000604b361', '56', 'Paz / Starlink Demo', '2018-02-22T14:17:00.000Z', 'First flight with fairing 2.0. Will also carry two SpaceX test satellites for the upcoming Starlink constellation.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d14ffd86e000604b361', 'http://localhost:3000/images/I9duWQ6v_o.png');
