insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d15ffd86e000604b362', '57', 'Hispasat 30W-6', '2018-03-06T05:33:00.000Z', 'Launched with landing legs and titanium grid fins. Did not attempt a landing due to ''unfavorable weather conditions in the recovery area''.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d15ffd86e000604b362', 'http://localhost:3000/images/ZDr6l98A_o.png');
