insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d16ffd86e000604b363', '58', 'Iridium NEXT Mission 5', '2018-03-30T14:13:51.000Z', 'Fifth Iridium NEXT mission to deploy ten Iridium NEXT satellites. Reused booster from third Iridium flight, and although controlled descent was performed, the booster was expended into the ocean. SpaceX planned a second recovery attempt of one half of the fairing using the specially modified boat Mr. Steven. However, the fairing''s parafoil twisted during the recovery, which led to water impact at high speed');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d16ffd86e000604b363', 'http://localhost:3000/images/Bn1RX3aO_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d16ffd86e000604b363', 'http://localhost:3000/images/3hj6BIWx_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d16ffd86e000604b364', '59', 'CRS-14', '2018-04-02T20:30:41.000Z', 'The launch used a refurbished booster (from CRS-12) for the 11th time, and a refurbished capsule (C110 from CRS-8) for the third time. External payloads include a materials research platform MISSE-FF phase 3 of the Robotic Refueling Mission TSIS, heliophysics sensor several crystallization experiments, and the RemoveDebris spacecraft aimed at space junk removal. The booster was expended in order to test a new landing profile.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d16ffd86e000604b364', 'http://localhost:3000/images/WzMju1cP_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d16ffd86e000604b364', 'http://localhost:3000/images/VGGRo5PT_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d18ffd86e000604b365', '60', 'TESS', '2018-04-18T22:51:00.000Z', 'Part of the Explorers program, this space telescope is intended for wide-field search of exoplanets transiting nearby stars. It is the first NASA high priority science mission launched by SpaceX. It was the first time SpaceX launched a scientific satellite not primarily intended for Earth observations. The second stage placed it into a high-Earth elliptical orbit, after which the satellite''s own booster will perform complex maneuvers including a lunar flyby, and over the course of two months, reach a stable, 2:1 resonant orbit with the Moon. In January 2018, SpaceX received NASA''s Launch Services Program Category 2 certification of its Falcon 9 ''Full Thrust'', certification which is required for launching medium risk missions like TESS. It was the last launch of a new Block 4 booster, and marked the 24th successful recovery of the booster. An experimental water landing was performed in order to attempt fairing recovery.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d18ffd86e000604b365', 'http://localhost:3000/images/EEGqRRto_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d18ffd86e000604b365', 'http://localhost:3000/images/pYXpOVCz_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d19ffd86e000604b366', '61', 'Bangabandhu-1', '2018-05-11T20:14:00.000Z', 'First launch of a Block V first stage.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d19ffd86e000604b366', 'http://localhost:3000/images/eavaQRYD_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d19ffd86e000604b366', 'http://localhost:3000/images/wlysigUT_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d1affd86e000604b367', '62', 'Iridium NEXT Mission 6', '2018-05-22T19:47:58.000Z', 'GFZ arranged a rideshare of GRACE-FO on a Falcon 9 with Iridium following the cancellation of their Dnepr launch contract in 2015. Iridium CEO Matt Desch disclosed in September 2017 that GRACE-FO would be launched on the sixth Iridium NEXT mission. The booster reuse turnaround was a record 4.5 months between flights.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d1affd86e000604b367', 'http://localhost:3000/images/hz3r2Lni_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d1affd86e000604b367', 'http://localhost:3000/images/IHjBUE1f_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d1bffd86e000604b368', '63', 'SES-12', '2018-06-04T04:45:00.000Z', 'SES-12, the replacement satellite for NSS-6, was successfully launched and deployed on June 4th, completing SpaceX''s eleventh flight of 2018. According to SES Luxembourg, The SES-12 satellite will expand SES’s capabilities to provide direct-to-home (DTH) broadcasting, VSAT, Mobility and High Throughput Satellite (HTS) data connectivity services in the Middle East and the Asia-Pacific region, including rapidly growing markets such as India and Indonesia. [SES-12] will be co-located with SES-8');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d1bffd86e000604b368', 'http://localhost:3000/images/oS8ezl6V_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d1bffd86e000604b368', 'http://localhost:3000/images/fvMeODet_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d1cffd86e000604b369', '64', 'CRS-15', '2018-06-29T09:42:00.000Z', 'Payload included MISSE-FF 2, ECOSTRESS, and a Latching End Effector. The refurbished booster featured a record 2.5 months period turnaround from its original launch of the TESS satellite — the fastest previous was 4.5 months. This was the last commercial flight of a Block 4 booster, which was expended into the Atlantic without landing legs and grid fins.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d1cffd86e000604b369', 'http://localhost:3000/images/xng5hAXN_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d1cffd86e000604b369', 'http://localhost:3000/images/0QW7yRsB_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d1effd86e000604b36a', '65', 'Telstar 19V', '2018-07-22T05:50:00.000Z', 'SSL-manufactured communications satellite intended to be placed at 63° West over the Americas. At 7,075 kg, it became the heaviest commercial communications satellite ever launched.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d1effd86e000604b36a', 'http://localhost:3000/images/NiniYxoh_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d1effd86e000604b36a', 'http://localhost:3000/images/5jklZkPz_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d1fffd86e000604b36b', '66', 'Iridium NEXT Mission 7', '2018-07-25T11:39:26.000Z', 'SpaceX''s fourteenth flight of 2018 and seventh of eight launches in a half-a-billion-dollar contract with Iridium. Will use a Block 5 first stage, to be recovered in the Pacific Ocean. Only one mission will be left for Iridium, with 10 more satellites. First attempt to recover a Fairing with the upgraded net. Fairing recovery was not successful.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d1fffd86e000604b36b', 'http://localhost:3000/images/NE4EISfK_o.png');
