insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d20ffd86e000604b36c', '67', 'Merah Putih', '2018-08-07T05:18:00.000Z', 'SpaceX''s fifteenth flight of 2018 launched the Merah Putih (also known as Telkom-4) geostationary communications satellite for Telkom Indonesia. It marked the first reuse of any Block 5 first stage; the booster B1046 had previously launched Bangabandhu-1. The stage was recovered and is expected to become the first Falcon 9 booster to fly three missions.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d20ffd86e000604b36c', 'http://localhost:3000/images/sbwePzVD_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d20ffd86e000604b36c', 'http://localhost:3000/images/ZgdsrbqW_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d22ffd86e000604b36d', '68', 'Telstar 18V', '2018-09-10T04:45:00.000Z', 'SpaceX''s sixteenth flight of 2018 launched the Telstar 18v GEO communication satellite for Telesat, the second launch for the canadian company in a few months. The first stage was a new Falcon 9 V1.2 Block 5 which was successfully recovered on OCISLY.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d22ffd86e000604b36d', 'http://localhost:3000/images/jStsqeLC_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d22ffd86e000604b36d', 'http://localhost:3000/images/3plcm5IB_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d23ffd86e000604b36e', '69', 'SAOCOM 1A', '2018-10-08T02:22:00.000Z', 'SpaceX''s seventeenth flight of 2018 was the first launch of the Saocom Earth observation satellite constellation of the Argentine Space Agency CONAE. The second launch of Saocom 1B will happen in 2019. This flight marked the first RTLS launch out of Vandenberg, with a landing on the concrete pad at SLC-4W, very close to the launch pad.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d23ffd86e000604b36e', 'http://localhost:3000/images/H85gskPQ_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d23ffd86e000604b36e', 'http://localhost:3000/images/oVB1ofaZ_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d24ffd86e000604b36f', '70', 'Es’hail 2', '2018-11-15T20:46:00.000Z', 'SpaceX''s eighteenth flight of 2018 was its first for Es''hailSat. Es''hail-2 is a communications satellite delivering television and internet to Qatar and the surrounding region. It was launched into a geostationary transfer orbit from LC-39A at Kennedy Space Center. The booster landed on OCISLY.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d24ffd86e000604b36f', 'http://localhost:3000/images/WvJsBXuE_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d24ffd86e000604b36f', 'http://localhost:3000/images/HPYpMlux_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d25ffd86e000604b370', '71', 'SSO-A', '2018-12-03T18:34:00.000Z', 'SpaceX''s nineteenth flight of 2018 will fly SSO-A: SmallSat Express out of Vandenberg SLC-4E for Spaceflight. SSO-A is a rideshare to sun synchronus low earth orbit consisting of 64 individual microsatellites and cubesats. It is also likely to be the third flight of core B1046 which previously flew Bangabandhu-1 and Merah Putih. If this happens it will be the first time a Falcon 9 has flown more than two missions. ');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d25ffd86e000604b370', 'http://localhost:3000/images/s2SD7HuJ_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d25ffd86e000604b370', 'http://localhost:3000/images/YprVKOBk_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d26ffd86e000604b371', '72', 'CRS-16', '2018-12-05T18:16:00.000Z', 'SpaceX''s 16th Crew Resupply Mission on behalf of NASA, with a total of 20 contracted flights. This will bring essential supplies to the International Space Station using SpaceX''s reusable Dragon spacecraft. The Falcon 9 will launch from SLC-40 at Cape Canaveral Air Force Station. During the landing of the first stage, a grid fin hydraulic pump stalled, causing the core to enter an uncontrolled roll, and resulting in a (succesful) water landing.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d26ffd86e000604b371', 'http://localhost:3000/images/liJzNMRP_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d26ffd86e000604b371', 'http://localhost:3000/images/tLQrmwcl_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d27ffd86e000604b372', '73', 'GPS III SV01', '2018-12-23T13:51:00.000Z', 'SpaceX''s twenty-first flight of 2018 launched the first of the new GPS III satellites (Block IIIA) for the United States Air Force and was SpaceX''s first EELV mission. The spacecraft was delivered to a MEO transfer orbit from SLC-40 at Cape Canaveral Air Force Station. This mission was the first to fly with the redesigned COPV on the first stage (B1054) as well as the second. The booster was expended.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d27ffd86e000604b372', 'http://localhost:3000/images/vKUtLIu9_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d27ffd86e000604b372', 'http://localhost:3000/images/cvLgCm0d_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d28ffd86e000604b373', '74', 'Iridium NEXT Mission 8', '2019-01-11T15:31:00.000Z', 'SpaceX''s first flight of 2019 will be the eighth and final launch of its planned Iridium flights. Delivering 10 satellites to low earth orbit, this brings the total up to 75 and completes the Iridium NEXT constellation. This mission launches from SLC-4E at Vandenberg AFB. The booster is expected to land on JRTI.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d28ffd86e000604b373', 'http://localhost:3000/images/xPDcIpmS_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d28ffd86e000604b373', 'http://localhost:3000/images/1JL1ZzXD_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d2affd86e000604b374', '75', 'Nusantara Satu (PSN-6) / S5 / Beresheet', '2019-02-22T01:45:00.000Z', 'SpaceX will launch this rideshare to GTO for Space Systems Loral (SSL). The primary payload for this mission is Nusantara Satu, a communications satellite built by SSL for the private Indonesian company PT Pasifik Satelit Nusantara (PSN). Spaceflight Industries'' GTO-1 mission consists of two secondary payloads. One of those is Beresheet, the lunar lander built by the Israeli non-profit organization, SpaceIL. Beresheet will make its own way to the moon from GTO. The other secondary is Air Force Research Lab''s (Space Situational Awareness) S5 mission, which hitches a ride to GEO aboard Nusantara Satu. This mission launches from SLC-40 at Cape Canaveral AFS. The booster is expected to land on OCISLY.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d2affd86e000604b374', 'http://localhost:3000/images/wAkWv7k7_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d2affd86e000604b374', 'http://localhost:3000/images/rJ4HAYkk_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d2bffd86e000604b375', '76', 'CCtCap Demo Mission 1', '2019-03-02T07:45:00.000Z', 'Demonstration Mission 1 (DM-1) will launch Dragon 2 as part of NASA''s Commercial Crew Transportation Capability program. This mission will demonstrate Dragon 2, and Falcon 9 in its configuration for crewed missions. DM-1 will launch from LC-39A at Kennedy Space Center, likely carrying some cargo to the International Space Station. The booster is expected to land on OCISLY.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d2bffd86e000604b375', 'http://localhost:3000/images/gOkzvXPe_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d2bffd86e000604b375', 'http://localhost:3000/images/YKd36su1_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d2dffd86e000604b376', '77', 'ArabSat 6A', '2019-04-11T22:35:00.000Z', 'SpaceX will launch Arabsat 6A to a geostationary transfer orbit from SLC-39A, KSC. The satellite is a geostationary telecommunications satellite built by Lockheed Martin for the Saudi Arabian company Arabsat. This will be the first operational flight of Falcon Heavy, and also the first Block 5 Falcon Heavy. All three cores will be new Block 5 cores. The side cores are expected to land at LZ-1 and LZ-2, and the center core is expected to land on OCISLY.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d2dffd86e000604b376', 'http://localhost:3000/images/YJDi2l1n_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d2dffd86e000604b376', 'http://localhost:3000/images/RzQ9nX2V_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d2effd86e000604b377', '78', 'CRS-17', '2019-05-04T06:48:00.000Z', 'SpaceX''s 17th Commercial Resupply Services mission for NASA out of a total of 20 contracted flights, this mission brings essential supplies to the International Space Station using SpaceX''s reusable Dragon 1 spacecraft. The external payloads for this mission include Orbital Carbon Observatory 3 and Space Test Program-Houston 6. The Falcon 9 launches from SLC-40 at Cape Canaveral AFS. The booster was expected to land at LZ-1, however, due to the ongoing investigation and clean-up following the Crew Dragon testing incident, it is likely to land on OCISLY instead.
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d2effd86e000604b377', 'http://localhost:3000/images/9UErD3ut_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d2effd86e000604b377', 'http://localhost:3000/images/6uim8L1a_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d30ffd86e000604b378', '79', 'Starlink v0.9', '2019-05-24T02:30:00.000Z', 'SpaceX will launch dozens of Starlink demonstration satellites from SLC-40, Cape Canaveral AFS. Starlink is a low Earth orbit broadband internet constellation developed and owned by SpaceX which will eventually consist of nearly 12 000 satellites and will provide low latency internet service to ground terminals around the world. Two prototype satellites, Microsats 2a and 2b, were launched from Vandenberg AFB in February 2018. The booster for this mission will land on OCISLY.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d30ffd86e000604b378', 'http://localhost:3000/images/MGYJy1JY_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d30ffd86e000604b378', 'http://localhost:3000/images/jIMV5w8x_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d31ffd86e000604b379', '80', 'RADARSAT Constellation', '2019-06-12T14:17:00.000Z', 'SpaceX is launching the three satellite RADARSAT Constellation Mission into Sun Synchronous orbit from SLC-4E, VAFB. The RCM spacecraft are synthetic aperture radar (SAR) Earth observation satellites built by the Canadian space company, MDA, for the Canadian Space Agency. This mission was delayed when the originally slated booster failed to land after CRS-16. The booster is expected to return to LZ-4.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d31ffd86e000604b379', 'http://localhost:3000/images/qsIUVh1j_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d31ffd86e000604b379', 'http://localhost:3000/images/2irK3PGj_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d35ffd86e000604b37a', '81', 'STP-2', '2019-06-25T03:30:00.000Z', 'Space Test Program 2 is a rideshare managed by the U.S. Air Force Space and Missile Systems Center (SMC), launching from LC-39A, KSC. Most of the spacecraft will be delivered into low Earth orbit (LEO) in two deployment sequences separated by a second stage burn. These LEO payloads include the six Taiwan and United States owned COSMIC-2 microsatellites, the Planetary Society''s LightSail-B demonstrator cubesat, and others. The third and final deployment will be the Air Force Research Lab''s DSX spacecraft, which will be delivered to a medium Earth orbit (MEO). This mission will reuse the side cores from Arabsat 6A, which will return to LZ-1, and LZ-2. The new center core will boost back to land on OCISLY less than 40 km from the launch site.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d35ffd86e000604b37a', 'http://localhost:3000/images/BvwaqoS0_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d35ffd86e000604b37a', 'http://localhost:3000/images/gCjLjHbl_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d36ffd86e000604b37b', '82', 'CRS-18', '2019-07-25T22:01:00.000Z', 'SpaceX''s 18th Commercial Resupply Services mission out of a total of 20 such contracted flights for NASA, this launch will deliver essential supplies to the International Space Station using the reusable Dragon 1 cargo spacecraft. The external payload for this mission is International Docking Adapter 3, replacing IDA-1 lost in SpaceX''s CRS-7 launch failure. This mission will launch from SLC-40 at Cape Canaveral AFS on a Falcon 9, and the first-stage booster is expected to land back at CCAFS LZ-1.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d36ffd86e000604b37b', 'http://localhost:3000/images/61VCHZwd_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d36ffd86e000604b37b', 'http://localhost:3000/images/bPpNeIRJ_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d37ffd86e000604b37c', '83', 'Amos-17', '2019-08-06T22:52:00.000Z', 'SpaceX will launch Boeing built Amos-17, a geostationary communications satellite for Israeli company Spacecom. The satellite will be delivered to GTO from KSC LC-39A or possibly CCAFS SLC-40, and will replace the defunct Amos-5 at 17° E. Amos-17 carries multi-band high throughput and regional beams servicing Africa, Europe and the Middle East. The cost of this launch is covered for Spacecom by SpaceX credit following the Amos-6 incident. A recovery of the booster for this mission is not expected.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d37ffd86e000604b37c', 'http://localhost:3000/images/WAkSmKfY_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d37ffd86e000604b37c', 'http://localhost:3000/images/XUoByiuR_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d39ffd86e000604b37d', '84', 'Starlink-1', '2019-11-11T14:56:00.000Z', 'This mission will launch the first batch of Starlink version 1.0 satellites, from SLC-40, Cape Canaveral AFS. They are expected to contribute to the 550 km x 53° shell. It is the second Starlink launch overall. Starlink is a low Earth orbit broadband internet constellation developed and owned by SpaceX which will eventually consist of nearly 12 000 satellites and will provide low latency internet service to ground terminals around the world. The booster for this mission is expected to land on OCISLY.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d39ffd86e000604b37d', 'http://localhost:3000/images/BrW201S.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d39ffd86e000604b37d', 'http://localhost:3000/images/573IfGk.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d39ffd86e000604b37e', '85', 'CRS-19', '2019-12-05T17:29:23.000Z', 'SpaceX''s 19th Crew Resupply Mission on behalf of NASA with a total of 20 contracted flights, this mission brings essential supplies to the International Space Station using SpaceX''s reusable Dragon spacecraft. The external payloads for this mission include the Hyperspectral Imager Suite and a lithium-ion battery. Falcon 9 and Dragon will launch from SLC-40, Cape Canaveral AFS. The mission will be complete with return and recovery of the Dragon capsule and down cargo.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d39ffd86e000604b37e', 'http://localhost:3000/images/FQWx8g9k_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d39ffd86e000604b37e', 'http://localhost:3000/images/3mc9OSdH_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d3bffd86e000604b37f', '86', 'JCSat 18 / Kacific 1', '2019-12-17T00:10:00.000Z', 'SpaceX will launch the Boeing built dual payload satellite to geostationary transfer orbit from XXXX. JCSat 18 is a mobile broadband communications payload built for Sky Perfect JSAT Corporation of Japan and will service Asia Pacific. Kacific 1 is a high throughput broadband internet payload built for Kacific Broadband Satellites and will service certain high demand areas of Southeast Asia and the Pacific. Both payloads share a single chassis. The booster for this mission is expected to land on OCISLY.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d3bffd86e000604b37f', 'http://localhost:3000/images/PotxLenG_o.png');
