insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d3cffd86e000604b380', '87', 'Starlink-2', '2020-01-07T02:19:00.000Z', 'This mission will launch the second batch of Starlink version 1.0 satellites, from SLC-40, Cape Canaveral AFS. They are expected to contribute to the 550 km x 53° shell. It is the third Starlink launch overall. Starlink is a low Earth orbit broadband internet constellation developed and owned by SpaceX which will eventually consist of nearly 12 000 satellites and will provide low latency internet service to ground terminals around the world. The booster for this mission is expected to land on OCISLY.');
