insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d3dffd86e000604b381', '88', 'Crew Dragon In Flight Abort Test', '2020-01-19T14:00:00.000Z', 'SpaceX will launch a Crew Dragon capsule from LC-39A, KSC on a fully fueled Falcon 9 rocket and then trigger the launch escape system during the period of maximum dynamic pressure. As part of NASA''a Commercial Crew Integrated Capability program (CCiCap) this test will contribute valuable data to help validate Crew Dragon and its launch abort system. The Crew Dragon will be recovered by GO Searcher after splashdown in the Atlantic Ocean. This flight does not go to orbit. The booster and upper stage are expected to break up following capsule separation and there will be no landing attempt.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d3dffd86e000604b381', 'http://localhost:3000/images/kTjuhrb0_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d3dffd86e000604b381', 'http://localhost:3000/images/DNXjbXDY_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d3fffd86e000604b382', '89', 'Starlink-3', '2020-01-29T14:06:00.000Z', 'This mission will launch the third batch of Starlink version 1.0 satellites, from SLC-40, Cape Canaveral AFS. It is the fourth Starlink launch overall. The satellites will be delivered to low Earth orbit and will spend a few weeks maneuvering to their operational altitude of 550 km. The booster for this mission is expected to land on OCISLY.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d3fffd86e000604b382', 'http://localhost:3000/images/BrW201S.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d3fffd86e000604b382', 'http://localhost:3000/images/573IfGk.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d41ffd86e000604b383', '90', 'Starlink-4', '2020-02-17T15:05:55.000Z', 'This mission will launch the fourth batch of Starlink version 1.0 satellites, from SLC-40, Cape Canaveral AFS. It is the fifth Starlink launch overall. The satellites will be delivered to low Earth orbit and will spend a few weeks maneuvering to their operational altitude of 550 km. The booster for this mission is expected to land on OCISLY.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d41ffd86e000604b383', 'http://localhost:3000/images/BrW201S.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d41ffd86e000604b383', 'http://localhost:3000/images/573IfGk.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d42ffd86e000604b384', '91', 'CRS-20', '2020-03-07T04:50:31.000Z', 'SpaceX''s 20th and final Crew Resupply Mission under the original NASA CRS contract, this mission brings essential supplies to the International Space Station using SpaceX''s reusable Dragon spacecraft. It is the last scheduled flight of a Dragon 1 capsule. (CRS-21 and up under the new Commercial Resupply Services 2 contract will use Dragon 2.) The external payload for this mission is the Bartolomeo ISS external payload hosting platform. Falcon 9 and Dragon will launch from SLC-40, Cape Canaveral Air Force Station and the booster will land at LZ-1. The mission will be complete with return and recovery of the Dragon capsule and down cargo.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d42ffd86e000604b384', 'http://localhost:3000/images/dh0XSLXO_o.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d42ffd86e000604b384', 'http://localhost:3000/images/NAcsTEB6_o.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d43ffd86e000604b385', '92', 'Starlink-5', '2020-03-18T12:16:00.000Z', 'The sixth Starlink launch overall and the fifth operational batch of Starlink satellites will launch into orbit aboard a Falcon 9 rocket. This mission is expected to deploy all sixty satellites into an elliptical orbit about fifteen minutes into flight. In the weeks following launch the satellites are expected to utilize their onboard ion thrusters to raise their orbits to 550 km in three groups of 20, making use of precession rates to separate themselves into three planes. The booster will land on a drone ship approximately 628 km downrange.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d43ffd86e000604b385', 'http://localhost:3000/images/BrW201S.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d43ffd86e000604b385', 'http://localhost:3000/images/573IfGk.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d44ffd86e000604b386', '93', 'Starlink-6', '2020-04-22T19:30:00.000Z', 'This mission will launch the sixth batch of operational Starlink satellites, which are expected to be version 1.0, from SLC-40, Cape Canaveral AFS. It is the seventh Starlink launch overall. The satellites will be delivered to low Earth orbit and will spend a few weeks maneuvering to their operational altitude of 550 km. The booster for this mission is expected to land on OCISLY.');
insert into Patch(patch_id, type, launch_id, url) values(null, 'S', '5eb87d44ffd86e000604b386', 'http://localhost:3000/images/BrW201S.png');
insert into Patch(patch_id, type, launch_id, url) values(null, 'L', '5eb87d44ffd86e000604b386', 'http://localhost:3000/images/573IfGk.png');
insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d45ffd86e000604b387', '95', 'Starlink-7', '2020-06-04T01:25:00.000Z', 'This mission will launch the seventh batch of operational Starlink satellites, which are expected to be version 1.0, from SLC-40, Cape Canaveral AFS. It is the eighth Starlink launch overall. The satellites will be delivered to low Earth orbit and will spend a few weeks maneuvering to their operational altitude of 550 km. The booster for this mission is expected to land on JRTI on its first mission since arriving at Port Canaveral.');
