insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d46ffd86e000604b388', '94', 'CCtCap Demo Mission 2', '2020-05-30T19:22:00.000Z', 'SpaceX will launch the second demonstration mission of its Crew Dragon vehicle as part of NASA''s Commercial Crew Transportation Capability Program (CCtCap), carrying two NASA astronauts to the International Space Station. Barring unexpected developments, this mission will be the first crewed flight to launch from the United States since the end of the Space Shuttle program in 2011. DM-2 demonstrates the Falcon 9 and Crew Dragon''s ability to safely transport crew to the space station and back to Earth and it is the last major milestone for certification of Crew Dragon. Initially the mission duration was planned to be no longer than two weeks, however NASA has been considering an extension to as much as six weeks or three months. The astronauts have been undergoing additional training for the possible longer mission.');
