insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d46ffd86e000604b389', '96', 'Starlink-8 & SkySat 16-18', '2020-06-13T09:21:00.000Z', 'This mission will launch the eighth batch of operational Starlink satellites, which are expected to be version 1.0, from SLC-40, Cape Canaveral AFS. It is the ninth Starlink launch overall. The satellites will be delivered to low Earth orbit and will spend a few weeks maneuvering to their operational altitude of 550 km. This mission is includes rideshare payloads, SkySats 16-18, on top of the Starlink stack. The booster for this mission is expected to land an ASDS.');
