insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d4affd86e000604b38b', '97', 'GPS III SV03 (Columbus)', '2020-06-30T19:55:00.000Z', 'SpaceX will launch GPS Block III Space Vehicle 03 from SLC-40, Cape Canaveral AFS aboard a Falcon 9. GPS III is owned and operated by the US Air Force and produced by Lockheed Martin. This is the third GPS III satellite and the second launched by SpaceX. The satellite will be delivered into a MEO transfer orbit. The booster for this mission is expected to land on an ASDS.');
