insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d4bffd86e000604b38c', '111', 'SXM-7', '2020-12-13T17:30:00.000Z', 'SpaceX will launch the first of two next generation high power S-band broadcast satellites for SiriusXM. The spacecraft will be delivered into a geostationary transfer orbit and the booster will be recovered downrange. The spacecraft is built by Space Systems Loral (SSL) on the SSL 1300 platform and includes two solar arrays producing 20kW, and an unfurlable antenna dish. SXM-7 will replace XM-3 in geostationary orbit.');
