insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d4effd86e000604b391', '110', 'CRS-21', '2020-12-06T16:17:00.000Z', 'SpaceX''s 21st ISS resupply mission on behalf of NASA and the first under the CRS-2 contract, this mission brings essential supplies to the International Space Station using the cargo variant of SpaceX''s Dragon 2 spacecraft. The external payload for this mission is the Nanoracks Bishop Airlock. Falcon 9 and Dragon launch from LC-39A, Kennedy Space Center and the booster is expected to land on an ASDS. The mission will be complete with return and recovery of the Dragon capsule and down cargo.');
