insert into Launch(id, flight_number, name, date_utc, details) values('5eb87d4fffd86e000604b393', '113', 'Turksat 5A', '2021-01-08T02:15:00.000Z', 'SpaceX will launch the first of two next generation satellites on contract for Türksat. Türksat 5A is a Ku-band broadcast satellite built by Airbus Defense and Space and based on the Electric Orbit Raising version of the Eurostar E3000 platform. This spacecraft will be delivered into a transfer orbit and will then raise itself to its operational 31° East geostationary orbit to serve Turkey, the Middle East, Europe, North Africa and South Africa. The booster for this mission will be recovered downrange via ASDS.');
