insert into Launch(id, flight_number, name, date_utc, details) values('5fe3af58b3467846b324215f', '123', 'Crew-2', '2021-04-23T09:49:00.000Z', 'SpaceX launches the second operational mission of its Crew Dragon vehicle as part of NASA''s Commercial Crew Program, carrying NASA astronauts Shane Kimbrough, Megan McArthur, Thomas Pesquet, and Akihiko Hoshide to the International Space Station. The Falcon 9 and Crew Dragon lift off from LC-39A, Kennedy Space Center. Both the booster and the capsule have flown previously, each a first for a commercial crew flight. The booster for this mission is expected to land on an ASDS. The mission will be complete with the safe return of the astronauts to Earth.');
